import './results.css';
import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';
import { Scatter } from 'react-chartjs-2';
import 'chart.js/auto';
//import { drawQuadrantsPlugin } from './graph-shading.js'; // Adjust the path as necessary
//import { drawCenterCirclePlugin } from './center-circle.js'; // Adjust the path as necessary
import 'chartjs-plugin-annotation';
import Chart from 'chart.js/auto';

// Register custom plugins
//Chart.register(drawQuadrantsPlugin(Chart));
//Chart.register(drawCenterCirclePlugin(Chart));

import { explanations } from './explanations'; // Adjust the path as necessary


function Results() {
  const [userData, setUserData] = useState(null);
  const [selectedInfo, setSelectedInfo] = useState("");
  const chartRef = useRef(null);

  const location = useLocation();

  useEffect(() => {
    const queryParams = new URLSearchParams(location.search);
    const email = queryParams.get('email');

    if (email) {
      axios.get(`http://localhost:3001/api/user-data?email=${email}`)
        .then(response => {
          console.log('Data received:', response.data);
          setUserData(response.data);
        })
        .catch(error => {
          console.error('Error fetching user data:', error);
        });
    } else {
      console.error('No email provided in query parameters');
    }
  }, [location]);

  const chartData = userData ? {
    datasets: [{
      label: 'Leadership Style',
      data: [{
        x: parseInt(userData.winningFocus),
        y: parseInt(userData.teamFocus)
      }],
      backgroundColor: 'rgba(255, 99, 132, 1)',
      pointRadius: 20,
      showLine: false,
    }],
  } : {};

  const medianX = 18; // Median values for x-axis
  const medianY = 18; // Median values for y-axis

  const options = {
    aspectRatio: 1,
    layout: {
      padding: {
      top: 30,
      right: 30,
      bottom: 30,
      left: 30,}
    },
    backgroundColor: 'rgba(255,255,255,1)',
    scales: {
      x: {
        type: 'linear',
        position: 'bottom',
        min: 4,
        max: 33,
        title: {
          display: true,
          text: 'Win Focus',
          color: 'black',
          font: { size: 16 },
          position: 'bottom',
        },
        grid: {
          display: false,
          borderColor: 'transparent',
          drawBorder: false,
        },
        ticks: {
          display: false
        }
      },
      y: {
        min: 4,
        max: 33,
        title: {
          display: true,
          text: 'Team Focus',
          color: 'black',
          font: { size: 16 }
        },
        position: 'left',
        grid: {
          display: false,
          borderColor: 'transparent',
          drawBorder: false,
        },
        ticks: {
          display: false
        }
      }
    },
    maintainAspectRatio: true,
  };

  const explanations = {
    "Team Coach": {
      title: "Team Coach Leadership Style",
      description: "Congratulations! You have the Team Coach leadership style. This style is all about fostering a sense of teamwork and collaboration within your organization. You value team cohesion and believe that when your team works well together, they can achieve great things. You're like a coach on the sidelines, guiding your team to success.",
      advantages: [
        "Advantages:",
        "- You build strong bonds among your team members, leading to a positive work environment.",
        "- Collaboration and innovation thrive under your leadership.",
        "- Your team is likely to have high morale and productivity."
      ],
      drawbacks: [
        "Drawbacks:",
        "- Sometimes, you may hesitate to make quick decisions or address conflicts, which can slow down progress.",
        "- Balancing collaboration with timely actions can be challenging."
      ],
      potentialIssues: [
        "Potential Issues:",
        "- In fast-paced industries, overemphasizing cohesion may hinder adaptability to rapid changes.",
        "- Ensure your team remains agile and responsive to market shifts."
      ]
    },
    "Championship Driver": {
      title: "Championship Driver Leadership Style",
      description: "You embody the Championship Driver leadership style. This style combines a strong commitment to team success with a competitive spirit. You're highly results-oriented and determined to achieve your goals. Your drive inspires your team to strive for excellence, and you're always aiming for the top spot.",
      advantages: [
        "Advantages:",
        "- Your focus on success can lead to achieving ambitious targets and significant growth.",
        "- You motivate your team to surpass expectations and excel in their roles."
      ],
      drawbacks: [
        "Drawbacks:",
        "- Excessive competitiveness may create stress or burnout in your team members.",
        "- Balancing high expectations with support for well-being is crucial."
      ],
      potentialIssues: [
        "Potential Issues:",
        "- Be cautious not to prioritize winning at the expense of team dynamics.",
        "- Encourage open communication and maintain a positive work culture."
      ]
    },
    "Sidelined Manager": {
      title: "Sidelined Manager Leadership Style",
      description: "Your leadership style aligns with the Sidelined Manager approach. You tend to take a step back and let others lead, often hesitating to prioritize either team cohesion or winning. You believe in giving your team members autonomy and space to make decisions.",
      advantages: [
        "Advantages:",
        "- Your hands-off approach empowers team members to take ownership and develop their skills.",
        "- You foster a sense of autonomy and independence within your team."
      ],
      drawbacks: [
        "Drawbacks:",
        "- Lack of clear direction can lead to confusion or lack of progress.",
        "- Ensure you provide sufficient guidance and support when needed."
      ],
      potentialIssues: [
        "Potential Issues:",
        "- Inconsistency in leadership style can result in an unstable work environment.",
        "- Consider taking a more active role during critical phases or when guidance is essential."
      ]
    },
    "Hardcore Competitor": {
      title: "Hardcore Competitor Leadership Style",
      description: "You embrace the Hardcore Competitor leadership style. Winning is everything to you, and you're willing to push hard to achieve your goals. You place a high emphasis on results and may sometimes overlook team dynamics in pursuit of success. Your work ethic is second to none.",
      advantages: [
        "Advantages:",
        "- Your determination can result in rapid accomplishments and a competitive edge in the market.",
        "- You instill a strong work ethic in your team members."
      ],
      drawbacks: [
        "Drawbacks:",
        "- Intense competitiveness may strain relationships or create a stressful atmosphere.",
        "- Balancing ambition with teamwork and empathy is essential for long-term success."
      ],
      potentialIssues: [
        "Potential Issues:",
        "- Overemphasizing winning may lead to neglecting employee well-being.",
        "- Prioritize a healthy work-life balance for sustainable growth."
      ]
    }
  };

  const renderExplanation = () => {
    if (selectedInfo) {
      // Access the explanation based on the selected style
      const explanation = explanations[selectedInfo];
      if (explanation) {
        return (
          <div className="explanation">
            <h2>{explanation.title}</h2>
            <p>{explanation.description}</p>
            <h3>Advantages:</h3>
            <ul>
              {explanation.advantages.map((advantage, index) => (
                <li key={index}>{advantage}</li>
              ))}
            </ul>
            <h3>Drawbacks:</h3>
            <ul>
              {explanation.drawbacks.map((drawback, index) => (
                <li key={index}>{drawback}</li>
              ))}
            </ul>
            <h3>Potential Issues:</h3>
            <ul>
              {explanation.potentialIssues.map((issue, index) => (
                <li key={index}>{issue}</li>
              ))}
            </ul>
          </div>
        );
      }
    }

    // If no leadership style is selected, display a loading message
    return <p>Loading results...</p>;
  };




  return (
    <div className="results-container">
      <div className="centered-content">
        <h1 className="results-title">Your Results</h1>
        <p className="results-description">Here are the results of your leadership test:</p>
        {userData ? (
          <>
            <div className="chart-container" id="myChart"> {/* Add an id to the chart container */}
              <Scatter ref={chartRef} data={chartData} options={options} />
            </div>
            {selectedInfo && <div className="info-display">{selectedInfo}</div>}
            <div className="leader-info">
              <h2>Leader Type: {userData.leaderType}</h2>
              <p>{userData.leaderDescription}</p>
            </div>
          </>
        ) : (
          <p>Loading results...</p>
        )}
      </div>
    </div>
  );
}

export default Results;
